import styled from "styled-components";
function MenuBar() {return(<Navbar>
    <div>
        <h5>Home</h5>
        <h5>Account</h5>
    </div>
    <input type="text" placeholder="Search.."/>
</Navbar>)}
export default MenuBar;
const Navbar = styled.div`
    >*{
        display: inline;
    }
    input{
        width: 30%;
        margin-left: 30%;
        text-align: center;
        padding-top: 0.5%;
        padding-bottom: 0.5%;
        border-radius: 5px;
        font-size: large;
    }
    h5{
        display: inline-block;
        padding-right: 2%;
        color: whitesmoke;
    }

`;
